pragma solidity ^0.8.0;
// import "./IOffice.sol";
// import "./ISource.sol";
// import "hardhat/console.sol";
/*
the source contract always need office contract support.
*/


contract Source
{
    // IOffice officeContract;
    // uint count;
    address[] subSourceAdds;

    constructor()
    {
        // count = 0;
        // officeContract = IOffice(_officeAdd);
    }

    // modifier onlyAdmin(address _add)
    // {
    //     require(!officeContract.isOwnerOrOfficer(_add), "only admin allowed");
    //     _;
    // }

    function findAddressIndexInArray(address _add) private view returns (uint)
    {
        for(uint i = 0; i < subSourceAdds.length; ++i)
        {
            if (_add == subSourceAdds[i])
                return i;
        }
        return type(uint).max;
    }

    function hasAddress(address _add) external view returns (bool)
    {
        // console.log("check has address =>", _add);
        uint index = findAddressIndexInArray(_add);
        if (index != type(uint).max)
            return true;
        else
            return false;
    }

    function addAddress(address _verify, address _add) external
    {
        // count++;
        subSourceAdds.push(_add);
    }

    function getAddress(address _verify, uint index) external view returns (address)
    {
        require(index < subSourceAdds.length, "not in list");
        return subSourceAdds[index];
    }

    function removeAddress(address _verify, address _add) external
    {
        uint index = findAddressIndexInArray(_add);
        require(index != type(uint).max, "not in list");

        subSourceAdds[index] = subSourceAdds[subSourceAdds.length -1];
        subSourceAdds.pop();
        // count--;
    }

    function removeAddressByIndex(address _verify, uint index) external
    {
        require(index < subSourceAdds.length, "not in list");
        subSourceAdds[index] = subSourceAdds[subSourceAdds.length -1];
        subSourceAdds.pop();
        // count--;
    }
}
